import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import { NavLink, useNavigate } from "react-router-dom";
import  AuthContext  from "../../context/AuthContext"
import { useContext } from "react";
import React from "react";
import { redirect } from "react-router-dom";

function NAV(){
    const [auth, setAuth] = useContext(AuthContext);

    const history = redirect();

    function logout() {
        setAuth(null);
        history("/");
    }

    return (

                <Navbar bg="dark" variant="dark" expand="lg">
                    <Navbar.Brand href="/"><img src={"../../images/viken_logo.png"} alt="logo"></img>Viken BOLIGENTREPENÃ˜R</Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="mr-auto">
                            <NavLink to="/services" className="nav-link">
                                Tjenester
                            </NavLink>
                            <NavLink to="/references" className="nav-link">
                                 Referanser
                            </NavLink>
                            <NavLink to="/about" className="nav-link">
                                Om Oss
                            </NavLink>
                            <NavLink to="/contact" className="nav-link">
                                Kontakt Oss
                            </NavLink>
                            {auth ? (
                                <>
                                    |<NavLink to="/admin" className="nav-link">
                                        Admin
                                    </NavLink> 
                                    | <NavLink onClick={logout} className="nav-link"><button>Log Out</button></NavLink>
                                </>
                            ) : (
                                <NavLink to="/login" className="nav-link">
                                Login
                                </NavLink>
                            )}

                        </Nav>
                    </Navbar.Collapse>
                 </Navbar>
    );
}

export default NAV;
